/* 个人中心界面的路由组件 */
import React from "react";
import { connect } from "react-redux";
import { Result, List, Brief } from "antd-mobile";

class Personal extends React.Component {
  render() {
    return (
      <div>
        <Result
          img={
            <img src={requestAnimationFrame(`../../assets/images/头像1.png`)} />
          }
          title="张三"
          message="IBM"
        />

        <List renderHeader></List>
      </div>
    );
  }
}
export default connect((state) => ({}), {})(Personal);
